INSERT INTO [T_Settings_Files] (ID, Analysis_Tool, File_Name, Description, Active, Contents, Job_Usage_Count, HMS_AutoSupersede, MSGFPlus_AutoCentroid, Comment, Created, Last_Updated, Job_Usage_Last_Year) VALUES (166,'Sequest','FinniganDefSettings_IonFilter_PCGalnaz.xml','Use Extract_MSn. Filters to only retain spectra that contain at least two of the PCGalnaz reporter ions (204.087 m/z, 300.131 m/z and 503.21 m/z).  In addition, alters the parent ion mass by decreasing by 502.2023 Da.  Lastly, filters out the PCGalnaz reporter ions (+/- 0.7 m/z), the parent ion, and the charge-reduced parent ion (+/- 3.1 m/z)',1,'<sections><section name="ScanControl"><item key="ScanStart" value="1" /><item key="ScanStop" value="999999" /><item key="MaxIntermediateScansWhenGrouping" value="1" /></section><section name="MWControl"><item key="MWStart" value="200" /><item key="MWStop" value="5000" /></section><section name="IonCounts"><item key="IonCount" value="35" /></section><section name="MassTol"><item key="MassTol" value="3" /></section><section name="DtaGenerator"><item key="DtaGenerator" value="extract_msn.exe" /></section><section name="Charges"><item key="CreateDefaultCharges" value="True" /><item key="ExplicitChargeStart" value="0" /><item key="ExplicitChargeEnd" value="0" /></section><section name="SpectraFilter"><item key="FilterType" value="msms_spectrum_filter" /></section><section name="FilterOptions"><item key="FilterMode" value="4" /><item key="MinimumQualityScore" value="0.25" /><item key="GenerateFilterReport" value="True" /><item key="IncludeNLStatsOnFilterReport" value="True" /><item key="OverwriteExistingFiles" value="True" /><item key="DiscardValidSpectra" value="False" /><item key="EvaluateSpectrumQualityOnly" value="False" /><item key="MSLevelFilter" value="0" /><item key="ScanTypeFilter" value="" /><item key="ScanTypeMatchType" value="Contains" /><item key="MSCollisionModeFilter" value="" /><item key="MSCollisionModeMatchType" value="Contains" /></section><section name="IonFilterOptions"><item key="RemovePrecursor" value="False" /><item key="RemoveChargeReducedPrecursors" value="False" /><item key="RemoveNeutralLossesFromChargeReducedPrecursors" value="False" /><item key="PrecursorCleaningToleranceMZ" value="3.1" /><item key="NeutralLossCleaningWindowDa" value="60" /><item key="CondenseData" value="False" /><item key="CondenseDataMaxIonCount" value="0" /></section><section name="FilterMode4"><item key="ReporterIonMZs" value="204.0871934, 300.130787, 503.2101566" /><item key="ReporterIonIntensityThreshold" value="50" /><item key="ReporterIonToleranceHalfWidthMZ" value="0.7" /><!-- Reporter ions are removed with a tolerance of +/- "ReporterIonToleranceHalfWidthMZ"  --><item key="RemoveReporterIons" value="True" /><item key="PrecursorIonMassLossDa" value="502.2023" /><item key="ReporterIonMatchCountMinimum" value="2" /><!-- Precursor ions are removed with a tolerance of +/- "PrecursorCleaningToleranceMZ"  --><item key="RemoveMassCorrectedPrecursorIons" value="True" /><item key="PrecursorIonMinimumCharge" value="2" /></section></sections>',0,null,null,null,'11/19/2010 3:37:33 PM','11/19/2010 3:37:33 PM',0)
INSERT INTO [T_Settings_Files] (ID, Analysis_Tool, File_Name, Description, Active, Contents, Job_Usage_Count, HMS_AutoSupersede, MSGFPlus_AutoCentroid, Comment, Created, Last_Updated, Job_Usage_Last_Year) VALUES (167,'Sequest','FinniganDefSettings_DeconMSn_CIDOnly_IonFilter_PCGalnaz_RemoveParentAndReporter.xml','DeconMSn, use for orbitrap MS/MS searching. Filters to only retain CID spectra that contain at least two of the PCGalnaz reporter ions (204.087 m/z, 300.131 m/z and 503.21 m/z), with an intensity of at least 50 counts for one and 500 counts for the other.  In addition, alters the parent ion mass by decreasing by 502.2023 Da.  Lastly, filters out the PCGalnaz reporter ions (+/- 0.7 m/z), the parent ion, and the charge-reduced parent ion (+/- 0.7 m/z)',1,'<sections><section name="ScanControl"><item key="ScanStart" value="1" /><item key="ScanStop" value="999999" /><item key="MaxIntermediateScansWhenGrouping" value="1" /></section><section name="MWControl"><item key="MWStart" value="200" /><item key="MWStop" value="5000" /></section><section name="IonCounts"><item key="IonCount" value="35" /></section><section name="MassTol"><item key="MassTol" value="3" /></section><section name="DtaGenerator"><item key="DtaGenerator" value="DeconMSN.exe" /></section><section name="Charges"><item key="CreateDefaultCharges" value="True" /><item key="ExplicitChargeStart" value="0" /><item key="ExplicitChargeEnd" value="0" /></section><section name="SpectraFilter"><item key="FilterType" value="msms_spectrum_filter" /></section><section name="FilterOptions"><item key="FilterMode" value="4" /><item key="MinimumQualityScore" value="0.25" /><item key="GenerateFilterReport" value="True" /><item key="IncludeNLStatsOnFilterReport" value="True" /><item key="OverwriteExistingFiles" value="True" /><item key="DiscardValidSpectra" value="False" /><item key="EvaluateSpectrumQualityOnly" value="False" /><item key="MSLevelFilter" value="0" /><item key="ScanTypeFilter" value="" /><item key="ScanTypeMatchType" value="Contains" /><item key="MSCollisionModeFilter" value="cid" /><item key="MSCollisionModeMatchType" value="Contains" /></section><section name="IonFilterOptions"><item key="RemovePrecursor" value="False" /><item key="RemoveChargeReducedPrecursors" value="False" /><item key="RemoveNeutralLossesFromChargeReducedPrecursors" value="False" /><item key="PrecursorCleaningToleranceMZ" value="0.7" /><item key="NeutralLossCleaningWindowDa" value="60" /><item key="CondenseData" value="False" /><item key="CondenseDataMaxIonCount" value="0" /></section><section name="FilterMode4"><item key="ReporterIonMZs" value="204.0871934, 300.130787, 503.2101566" /><item key="ReporterIonMinimumIntensity" value="50" /><item key="ReporterIonToleranceHalfWidthMZ" value="0.7" /><!-- Reporter ions are removed with a tolerance of +/- "ReporterIonToleranceHalfWidthMZ"  --><item key="RemoveReporterIons" value="True" /><item key="PrecursorIonMassLossDa" value="502.2023" /><item key="ReporterIonMatchCountMinimum" value="2" /><item key="ReporterIonMaxIntensityThreshold" value="500" /><!-- Precursor ions are removed with a tolerance of +/- "PrecursorCleaningToleranceMZ"  --><item key="RemoveMassCorrectedPrecursorIons" value="True" /><item key="PrecursorIonMinimumCharge" value="2" /></section></sections>',1,null,null,null,'11/19/2010 3:44:08 PM','11/22/2010 5:02:41 PM',0)
