INSERT INTO [T_Settings_Files] (ID, Analysis_Tool, File_Name, Description, Active, Contents, Job_Usage_Count, HMS_AutoSupersede, MSGFPlus_AutoCentroid, Comment, Created, Last_Updated, Job_Usage_Last_Year) VALUES (390,'MSGFPlus_MzML','IonTrapDefSettings_MzML.xml','Process a .mzML file with MS-GF+. Create the mzML file using MSConvert, centroid=true, keep all peaks when centroiding. Store the file in the MzML cache and not in the dataset folder. Run MzRefinery with no mods. Although Java Memory size is shown as 8192 MB, the analysis manager will use a larger value for searches with large FASTA files or instrument files with a large number of spectra.',1,'<sections><section name="MSXMLGenerator"><item key="MSXMLGenerator" value="MSConvert.exe" /><item key="MSXMLOutputType" value="mzML" /><item key="CentroidMSXML" value="True" /><item key="CentroidPeakCountToRetain" value="-1" /></section><section name="MSXMLOptions"><item key="StoreMSXmlInCache" value="True" /><item key="StoreMSXmlInDataset" value="False" /></section><section name="MzRefinery"><item key="MzRefParamFile" value="MzRef_NoMods.txt" /></section><section name="MzRefineryRuntimeOptions"><item key="MzRefMSGFPlusJavaMemorySize" value="8192" /></section><section name="MSGFPlus"><item key="MSGFPlusJavaMemorySize" value="8192" /><item key="MSGFPlusThreads" value="all" /></section></sections>',44167,null,null,null,'9/4/2014 6:06:48 PM','2/8/2024 11:05:53 AM',7253)
