INSERT INTO [T_Settings_Files] (ID, Analysis_Tool, File_Name, Description, Active, Contents, Job_Usage_Count, HMS_AutoSupersede, MSGFPlus_AutoCentroid, Comment, Created, Last_Updated, Job_Usage_Last_Year) VALUES (392,'MSGFPlus_MzML','IonTrapDefSettings_MzML_NoRefine.xml','Process a .mzML file with MS-GF+. Create the mzML file using MSConvert, centroid=true, keep all peaks when centroiding. Store the file in the MzML cache and not in the dataset folder. Runs MzRefinery and creates mass error plots, but the new mzML file is identical to the original one. Disabled because creates a duplicate .mzml.gz file. Instead use script MSGFPlus_MzML_NoRefine with settings file IonTrapDefSettings_MzML_NoRefine.xml',0,'<sections><section name="MSXMLGenerator"><item key="MSXMLGenerator" value="MSConvert.exe" /><item key="MSXMLOutputType" value="mzML" /><item key="CentroidMSXML" value="True" /><item key="CentroidPeakCountToRetain" value="-1" /></section><section name="MSXMLOptions"><item key="StoreMSXmlInCache" value="True" /><item key="StoreMSXmlInDataset" value="False" /></section><section name="MzRefinery"><item key="MzRefParamFile" value="MzRef_NoMods_SkipRefinement.txt" /></section><section name="MzRefineryRuntimeOptions"><item key="MzRefMSGFPlusJavaMemorySize" value="4000" /></section><section name="MSGFPlus"><item key="MSGFPlusJavaMemorySize" value="4000" /><item key="MSGFPlusThreads" value="all" /></section></sections>',56,null,null,null,'9/17/2014 6:12:11 PM','1/31/2017 10:30:33 AM',0)
