ing the protein report" /><item key="PhilosopherFDR_Protein" value="0.99" comment="Protein-level FDR filter used by philosopher when generating the protein report" /><item key="PhilosopherIncludeDecoys" value="true" comment="Include decoy peptides and proteins in report files" /><item key="MS1QuantDisabled" value="false" comment="If true, disables FreeQuant and IonQuant" /><item key="RunFreeQuant" value="auto" /><item key="RunIonQuant" value="auto" /><item key="RunLabelQuant" value="false" /><item key="ReporterIonMode" value="auto" comment="This can be used to specify tmt6 or tmt10 instead of tmt11, or to specify tmt18 instead of tmt16" /></section></sections>',2,null,null,null,'3/9/2023 6:31:37 PM','3/9/2023 6:51:28 PM',0)
